import React from 'react'

export default function Footer() {
  return (
    <footer>
        <div className="case-study-archived" style = { { display: 'flex', justifyContent: 'center', backgroundColor: 'black', borderRadius: '1.5em', border:'1px orange dashed' }}>
            <p style = { { color: 'white' }}>Designed and coded by Göksu Dayan</p>
        </div>
    </footer>

  )
}
